import React from "react";
import { Route, Routes, Switch } from "react-router-dom";
import { ToastContainer } from "react-toastify";
import Home from "./Functionality/Home";
import NavBar from "./Functionality/navbar";
const App = () => {
  return (
    <div className="App">
      <ToastContainer />
      <NavBar />
      <div>
        <button onClick={<add />}>Add</button>
      </div>
      <switch>
        <Routes>
          <Route exact path="/" Functionality={() => <Home />} />
          <Route path="/add" element={<h1>i am add component</h1>}></Route>
          <Route
            exact
            path="/edit:id"
            element={<h1>i am edit component</h1>}
          ></Route>
        </Routes>
      </switch>
    </div>
  );
};

export default App;
